Queen: Absolute Greatest is a compilation album by the English Rock band Queen, which is expected to be released on 9th November 2009 in the United Kingdom (10th November in North America). The Album features 20 of their most famous hits throughout their career on one CD for the very first time and is available in several formats including the single CD edition, a 2CD special edition featuring audio commentaries by Brian May &amp; Roger Taylor, a 52 page hardback book with the 2 CD's, digital download, and LP edition box set. Each track has been remastered from the original tapes.

